import React from "react";
import logoImage from './logo.png';


const customStyle = {
    color : "red",
    textShadow : "2px 2px 5px yellow",
    fontFamily: "Times New Roman",  
    fontWeight: "bold",
    padding: "0px 40px",
  }
  

function Header (){
    return (
        <header>
            <h1 style={customStyle}>Aptitude Test</h1>
            <div className="d-flex align-items-center mb-4">
        <img src={logoImage} alt="Company Logo" className="me-3" width="100" height="100" />
      </div>
        </header>


    )
}

export default Header;
